샌박은 크리에이터들이 모여서 좀 더 쉽게 방송하라고 만든 회사지 노래 만드는 회사가 아니거든^^
그리고 노래 시작하기 전에 이 노래는 샌박거 아니라더구만 왜 그걸 못믿니 영상 찍은 스트리머가 만든건데... 제발 저작권과 샌박 창설 의의를 머가리에 박고 살아라 제발;

Tail call 최적화를 위해서
JMP 지우;
로 바꾸는건 어떨까요

